        public static void Execute()
        {
            Console.WriteLine($"Number of blocks: {TestGame(Input)}");
            Console.WriteLine($"Score after completing the game: {PlayGame(Input2)}");
            Console.WriteLine($"Score after completing the game: {PlayGame(Input)}");
        }

        private static object PlayGame(List<long> intCode)
        {
            var game = new IntCodeComputer(intCode);
            game.Memory[0] = 2;
            var joyStick = 0;
            var blocks = 0;
            long score = long.MinValue;
            do
            {
                var output = PlayFrame(game, joyStick).ToList();

                blocks = 0;
                long ballX = long.MinValue;
                long paddleX = long.MinValue;
                
                var maxWidth = output.Max(x => x.Item1);
                var maxHeight = output.Max(x => x.Item2);

                for (var y = 0; y <= maxHeight; y++)
                {
                    for (var x = 0; x <= maxWidth; x++)
                    {
                        var what = output.FirstOrDefault(o => o.Item1 == x && o.Item2 == y);
                        switch (what.Item3)
                        {
                            case 0:
                                Console.Write(" ");
                                break;
                            case 1:
                                Console.Write("#");
                                break;
                            case 2:
                                Console.Write("x");
                                blocks++;
                                break;
                            case 3:
                                Console.Write("_");
                                paddleX = x;
                                break;
                            case 4:
                                Console.Write("o");
                                ballX = x;
                                break;
                        }
                    }
                    Console.WriteLine();
                }

                Console.WriteLine($"Blocks left: {blocks}");
                Console.WriteLine($"Score: {output.FirstOrDefault(x => x.Item1 == -1).Item3}");

                joyStick = ballX.CompareTo(paddleX);
                game.Reset();
            } while (blocks > 0);

            return score;
        }

        private static IEnumerable<Tuple<long,long,long>> PlayFrame(IntCodeComputer game, long input)
        {
            do
            {
                yield return new Tuple<long,long,long>(game.Execute(new List<long> { input }), game.Execute(new List<long> { input }), game.Execute(new List<long> { input }));
            } while (!game.Halted);
        }

        private static int TestGame(List<long> intCode)
        {
            var game = new IntCodeComputer(intCode);
            var output = new List<long>();

            do
            {
                output.Add(game.Execute(null));
            } while (!game.Halted);

            return output.Where((x, i) => i % 3 == 2 && x == 2).Count();
        }



